import { useState } from "react";
import { Input, Textarea, DivNotas, Button, DivButton } from "./styles";
import { useParams } from "react-router-dom";

export const ListaNotas = ({ notas }) => {
    const { secaoId } = useParams();
    const [listaNotas, setListaNotas] = useState([
        {
            idsecao: '1',
            notas: ['Nota 1', 'Nota 2']
        },
        {
            idsecao: '2',
            notas: ['Nota 3', 'Nota 4']
        },
    ]);

    return (
        <DivNotas>
            {listaNotas.filter((nota) => nota.idsecao === secaoId).map((notasFiltradas) => {
                return (
                    <li key={notasFiltradas.notas}>{notasFiltradas.notas}</li>
                );
            })}
        </DivNotas>
    );
}
